def getTrainningDataset(image, numPasturePoints, numNPasturePoints, seed):
  
  scale = config['trainning']['scale']
  nPoints = config['trainning']['nPoints']
  referenceMask = config['trainning']['referenceMask']

  image = image.addBands(referenceMask.select([0],['pasture']))

  points = image.sample(numPixels=math.trunc(nPoints * 5), scale=scale, seed=seed)
    
  pasturePoints = points.filter(ee.Filter.eq('pasture', 1)).limit(numPasturePoints)
  nPasturePoints = points.filter(ee.Filter.eq('pasture', 0)).limit(numNPasturePoints)

  result = pasturePoints.merge(nPasturePoints)
  result = result.set('band_order', points.get('band_order'))
  
  return result


